import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const PremiumDonorDetails = () => {
  const { id } = useParams();
  const [donorDetails, setDonorDetails] = useState({});
  
  useEffect(() => {
    const fetchDonorDetails = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/donors/${id}`);
        setDonorDetails(response.data);
      } catch (error) {
        console.error('Error fetching donor details:', error);
      }
    };

    fetchDonorDetails();
  }, [id]);

  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Donor Details</h2>
      <div style={{ background: 'white', padding: '10px', borderRadius: '5px' }}>
        <h3>Full Name: {donorDetails.first_name} {donorDetails.last_name}</h3>
        {/* Display other donor details */}
        <p>Email: {donorDetails.email}</p>
        <p>Blood Type: {donorDetails.blood_type}</p>
        {/* ... (other donor details) */}
      </div>
    </div>
  );
};

export default PremiumDonorDetails;
